import React from 'react';
import { order } from '../screens/OrderScreen';

function Test() {
  return (
    <div>
      {order.isPaid ? (
        <button>Download</button>
      ) : (
        <p>Order not paid yet</p>
      )}
    </div>
  );
}

export default Test;
